    pageMain.find(".absolute").eq(2).insertAfter(pageMain.find(".absolute").last());
    pageMain.find(".absolute").eq(4).insertAfter(pageMain.find(".absolute").last());
    
    pageMain.find(".absolute").eq(4).append(pageMain.find(".absolute").eq(5).html());
    
    pageMain.find(".absolute").eq(5).remove();
    
    //$("#pinfo").appendTo(pageMain);
